import React from "react";

function HospitalPatient() {
    const presc = [
        { name: "김환자", date: "2023-03-05"},
        { name: "황환자", date: "2023-04-06"},
        { name: "송환자", date: "2023-04-07"},
        { name: "강환자", date: "2023-04-07"},
        { name: "윤환자", date: "2023-05-08"}
    ];

    return (
        <div className="main">
            <div className='list'>
                {presc.map((pre, index) => {
                    return (
                        <button variant="primary" size="lg">
                            {pre.name}
                        </button>
                    ); 
                })}
            </div>
        </div>
    );
}

export default HospitalPatient;
